import React from 'react';
import './App.css';
import {Route,Link} from 'react-router-dom'
import HomePage from './pages/homepage/homepage.components';

const HatsPage= props => {
  console.log(props);
return(
 <div>
   <h1> HATS PAGE</h1>
 </div>
)
};

 const JacketsPage=props=>
 {console.log(props);
 return(
   <div>
     <button onClick={()=> props.history.push('/')}>HOME PAGE</button>
     <Link to='/hats'>HATS PAGE </Link>
     <h1>
       JACKETS PAGE :{props.match.params.hatsId}
     </h1>
   </div>

 )};

function App() {

  return (

    <div>

    <Route exact path='/' component={HomePage}  />
    <Route exact path='/hats' component={HatsPage} />
    <Route path='/hats/:hatsId' component={JacketsPage}  />


    </div>

  );
}

export default App;
